Since you're already creating a helper, maybe a second one would be feasible to reclaim some readability?
```javascript
function h(tag, ...children) {
     const el = document.createElement(tag);
     for (const child of children) {
         el.appendChild(child instanceof Node ? child : new Text(child));
     }
     return el;
}
```
Maybe reserving the second positional parameter for attributes as well.
